void m6502::domx_process()
{
    hif_cone_core_domux_sel();
    if (core_domux_sel == sc_dt::sc_lv< 3L >('0'))
    {
        hif_cone_core_alu_outl();
        core_dataol = core_alu_outl;
    }
    else if (core_domux_sel == sc_dt::sc_lv< 3L >("001"))
    {
        hif_cone_core_aregl();
        core_dataol = core_aregl;
    }
    else if (core_domux_sel == sc_dt::sc_lv< 3L >("010"))
    {
        hif_cone_core_psrl();
        core_dataol = core_psrl;
    }
    else if (core_domux_sel == sc_dt::sc_lv< 3L >("011"))
    {
        hif_cone_core_sregl();
        core_dataol = core_sregl;
    }
    else if (core_domux_sel == sc_dt::sc_lv< 3L >("100"))
    {
        hif_cone_core_xregl();
        core_dataol = core_xregl;
    }
    else if (core_domux_sel == sc_dt::sc_lv< 3L >("101"))
    {
        hif_cone_core_yregl();
        core_dataol = core_yregl;
    }
    else if (core_domux_sel == sc_dt::sc_lv< 3L >("110"))
    {
        hif_cone_core_pchl();
        core_dataol = core_pchl;
    }
    else if (core_domux_sel == sc_dt::sc_lv< 3L >('1'))
    {
        hif_cone_core_pcll();
        core_dataol = core_pcll;
    }
    else
    {
        core_dataol = sc_dt::sc_lv< 8L >('X');
    }
}

